    return (
        <article className={style.opium}>
            <div className={style.opium_wrapper}>

                {partOfState.t1 && <h2>{partOfState.t1}</h2> }
                {partOfState.p1 && 
                <div className={style.opium__textBlock}>
                    <p className={style.opium__text}>
                        {partOfState.p1 && partOfState.p1}
